import React from "react";
import TextField from "@mui/material/TextField";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import {
  IconButton,
  FormControl,
  FormControlLabel,
  Checkbox,
  FormLabel,
} from "@mui/material";
import { Visibility, VisibilityOff } from "@mui/icons-material";
import {
  InputLabel,
  InputAdornment,
  OutlinedInput,
  RadioGroup,
  Radio,
  Link,
} from "@mui/material";
import { useNavigate } from "react-router-dom";
import { useState } from "react";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import { LocalizationProvider } from "@mui/x-date-pickers/LocalizationProvider";
import { DatePicker } from "@mui/x-date-pickers/DatePicker";
import dayjs from "dayjs";

export default function SignUp() {
  const [showPassword, setShowPassword] = useState(false);
  const [data, setData] = useState({
    firstName: "",
    lastName: "",
    email: "",
    password: "",
    gender: "",
  });
  const [check, setCheck] = useState(false);
  const [value, setValue] = useState(dayjs());

  const handledInputChange = (e) => {
    const { name, value } = e.target;
    setData((previousData) => ({
      ...previousData,
      [name]: value,
    }));
  };
  const handleCheckChange = (e) => {
    setCheck(e.target.checked);
  };

  const navigate = useNavigate();
  const handleClickShowPassword = () => setShowPassword((show) => !show);

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  const LoginPage = () => {
    if (
      data.password.length >= 8 &&
      data.firstName &&
      data.lastName &&
      data.email &&
      data.password &&
      data.gender &&
      check
    ) {
      navigate("/login");
      const existingUsers = JSON.parse(localStorage.getItem("Users")) || [];
      const updatedUers = [...existingUsers, data];
      localStorage.setItem("Users", JSON.stringify(updatedUers));
      console.log(data);
    } else {
      setData({
        ...data,
        password: "",
      });
    }
  };

  return (
    <Box sx={{backgroundColor:'green',minheight:'100vh',display:'flex',alignItems:'center',justifyContent:'center',p:2}}>
      <Box
        component="form"
        sx={{
          textAlign:'center',
          width: '100%',
          maxWidth:'500px',
          p:3,
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
          justifyContent: "center",
          border: "2px solid grey",
          borderRadius: "20px",
          bgcolor: "#cfd8dc",
        }}
      >
        
      <h1>Sign Up</h1>
      It's Quick And Easy
        
       <div>
          <TextField
            id="outline-required"
            label="First-Name"
            name="firstName"
            onChange={handledInputChange}
            value={data.firstName}
            widht='100%'
            // defaultValue="Hello World"
          />
          <TextField
            id="outline-required"
            label="Last Name"
            name="lastName"
            onChange={handledInputChange}
            value={data.lastName}
            widht='100%'
            // defaultValue="Hello World"
          />
          </div>
          
          <FormControl sx={{ m:1, width: "100%",paddingTop:1 }}>
            <TextField
              id="outlined-email-input"
              label="Email Address"
              name="email"
              value={data.email}
              onChange={handledInputChange}
            />
          </FormControl>
         
          <FormControl
            sx={{m:1, width: "100%" }}
            variant="outlined"
          >
            <InputLabel htmlFor="outlined-adornment-password">
              New Password
            </InputLabel>
            <OutlinedInput
              id="outlined-adornment-password"
              name="password"
              value={data.password}
              onChange={handledInputChange}
              type={showPassword ? "text" : "password"}
              endAdornment={
                <InputAdornment position="end">
                  <IconButton
                    aria-label="toggle password visibility"
                    onClick={handleClickShowPassword}
                    onMouseDown={handleMouseDownPassword}
                    edge="end"
                  >
                    {showPassword ? <VisibilityOff /> : <Visibility />}
                  </IconButton>
                </InputAdornment>
              }
              label="New Password"
            />
          </FormControl>
        
          <LocalizationProvider dateAdapter={AdapterDayjs}>
            <DatePicker
              sx={{ m:1, width: "100%" }}
              label="Date of Birth"
              value={value}
              onChange={(newValue) => setValue(newValue)}
            />
          </LocalizationProvider>
        
        <FormLabel id="demo-radio-buttons-group-label"></FormLabel>
        <RadioGroup
          row
          aria-labelledby="demo-radio-buttons-group-label"
          value={data.gender}
          onChange={handledInputChange}
          name="gender"
        >
          <FormControlLabel value="female" control={<Radio />} label="Female" />
          <FormControlLabel value="male" control={<Radio />} label="Male" />
        </RadioGroup>

        <FormControlLabel
          required
          control={<Checkbox />}
          label="I Agree to Terms and Conditions"
          checked={check}
          onChange={handleCheckChange}
        />
        <Button
          variant="contained"
          sx={{ m:1, widht: '100%' }}
          onClick={() => {
            LoginPage();
          }}
        >
          Submit Details
        </Button>
        <p>
          Already have an Account?
          <Link href="/login" relative="path">
            Login
          </Link>
        </p>
      </Box>
    </Box>
  );
}
